import styled from "styled-components";

export const StyledHeader = styled.header`
  background-color: var(--color-gray-4);
  height: 15vh;

  div {
    width: 70%;
    margin: 0 auto;
    display: flex;
    justify-content: space-between;
    align-items: center;
  }
`;
